import React from "react";
import { useState, useEffect } from "react";

const SignIn = () => {
    const [ user, setUser ] = useState({
        "username": '',
        "password": ''
    }) 

    function handleChange(e){
        const { name, value } = e.target;

        setUser((prevUser) => ({
            ...prevUser,
            [name]: value
        }))
    }

    return(
        <div>
            <div>
                <label>Username</label>
                <input placeholder="Username" type="text" name="username" value={user['username']} onChange={(e) => handleChange(e)}/>
            </div>
            <div>
                <label>Password</label>
                <input placeholder="Password" type="password" name="password" value={user['password']} onChange={(e) => handleChange(e)} />
            </div>
        </div>
    )
}

export default SignIn;
